import React, { useEffect, useState } from "react";
import './Feed.css';
import TweetBox from "./TweetBox";


const Feed = () => {
    const [post, setPost] = useState([]);

    useEffect(() => {
        fetch('http://localhost:5000/post')
            .then(res => res.json())
            .then(data => {
                setPost(data);
            })
    }, [post])
    return (
        <div className="feed">
            <div className="feed__header">
                <h2>Home</h2>
            </div>
            <TweetBox />
            {
                post.map(p => <post key={p._id} p={p} />)
            }
        </div>
    );
}

export default Feed;
